import React from 'react'
import event from './images/events.jpeg'
import Modal from 'react-bootstrap/Modal';
import Button from 'react-bootstrap/Button';



const Event1 = () => {
    const headerStyle = {
        backgroundImage: `url(${event})`,
        backgroundSize: '1297px',
        backgroundAttachment: 'fixed',
        height: '30vh',
        position: 'relative',
    };

    const headingStyle = {
        color: '#ffffff',
        fontSize: '2rem',
        textTransform: 'uppercase',
        textAlign: 'center',
    };
    return (
        <>
            <header style={headerStyle}>
                <h1 style={headingStyle}>Our Work!</h1>
            </header>
            <div class="container">
                <h1 class="big-heading">Events:Unforgettable moments, boundless possibilities</h1>
            </div>
        </>
    )
}

export default Event1
